#set ($document = $xwiki.getDocument("DocumentsExporter.ConfigurationSheet"))
require(['jquery', 'xwiki-meta', "$document.getAttachmentURL('index.js')", "$document.getAttachmentURL('csv.min.js')", "$document.getAttachmentURL('jszip.min.js')", "$document.getAttachmentURL('FileSaver.min.js')"], function (jq, XM, nThen, CSV, Zip) {
    var saveAs = window.saveAs;

    var queryInput = jq('#documentsExporter-query');
    var fieldsInput = jq('#documentsExporter-fields');
    var exportButton = jq('#documentsExporter-export');
    var previewButton = jq('#documentsExporter-preview');
    var previewResult = jq('#documentsExporter-preview-result');
	var formattedInput = jq('#documentsExporter-formatted');
    var separatorInput = jq('#documentsExporter-separator');
    var saveConfiguration = jq('#documentsExporter-saveConfiguration');

    var documentsProgress = jq('#documentsExporter-documentsProgess');
	var attachmentsProgress = jq('#documentsExporter-attachmentsProgess');

    var restBaseUrl = XM.restURL.slice(0, XM.restURL.indexOf('/wikis/'));
    var restBaseDocUrl = XM.restURL.slice(0, XM.restURL.indexOf('/spaces/'));

    var processFields = function (fieldsTxt) {
        var fields = fieldsTxt.split(',').map(function (f) { return f.trim(); });

        // Get the fields starting with "doc."
        var docFields = fields.filter(function (f) {
            return f.indexOf('doc.') === 0; 
        }).map(function (prop) {
            return {
                property: prop.slice(4),
                id: prop
            }
        });

        // Get the fields without class
        var otherFields = fields.filter(function (f) {
            return f.indexOf(':') === -1 && f.indexOf('doc.') !== 0;
        }).map(function (prop) {
            return {
                property: prop,
                id: prop
            }
        });

        // Create a map of classes needed and properties needed for each class
        var objFields = {};
        fields.forEach(function (f) {
            var idx = f.indexOf(':');
            if (idx === -1) { return; }
            objFields[f.slice(0, idx)] = objFields[f.slice(0, idx)] || [];
            objFields[f.slice(0, idx)].push({
                property: f.slice(idx + 1),
                id: f
            });
        });

		return {
            docFields: docFields,
            objFields: objFields,
            otherFields: otherFields
        };
    };

    var getDocumentList = function (query, ctx, cb) {
        jq.ajax({
            url:"$xwiki.getURL('DocumentsExporter.DocumentsGetter', 'get', 'xpage=plain&outputSyntax=plain')",
            dataType: 'json',
            data: {
                query: query,
                fields: encodeURIComponent(JSON.stringify(ctx.fields))
            },
        }).done(function (data) {
            ctx.fields = data.fields;
            cb (void 0, data.list);
        }).fail(function (e) {
            cb(e);
        });
    };

    // should return desired href OR false
    var findRestURL = function (data, type) {
                console.log(data, type);
        if (!data.links) { return false; }

        var pattern = new RegExp('/' + type + '$');
        var f = data.links.filter(function (link) {            
            return pattern.test(link.rel);
        });
        // console.log(f.length === 1 && f[0].href);
        return f.length === 1 && f[0].href;
    };

    var parseFullName = function (fullName) {
        var ref = XWiki.Model.resolve(fullName, XWiki.EntityType.DOCUMENT);
        var res = [];
        while (ref && ref.name) {
            res.unshift(ref.name);
            ref = ref.parent;
        }
        return res;
    };

    var getPageResource = function (doc, ctx) {
        // doc is a fullName
        var fields = ctx.fields;
        var arrayRef = parseFullName(doc);
        var pageFullName = doc;
        var pageName = arrayRef.pop();
        var href = restBaseDocUrl;
        arrayRef.forEach(function (s) { href += '/spaces/' + encodeURIComponent(s); });
        href += '/pages/' + encodeURIComponent(pageName);

        var url = href + '?media=json';
        console.log(url);

        var addToQueue = ctx.addToQueue;
        var CSV_data = ctx.CSV_data;
        var addToAttachments = ctx.addToAttachments;

        // addToAttachments(pageName, null);

        addToQueue(function (w) {
            // for each document, collect everything you want to know about it
            var data = CSV_data[pageFullName] = {}; // basically anything we want in our CSV
            jq.ajax({
                url:"$xwiki.getURL('DocumentsExporter.Getter', 'get', 'xpage=plain&outputSyntax=plain')",
                data: {
                    formatted: ctx.formatted ? '1' : '0',
                    document: pageFullName, // something here
                    fields: encodeURIComponent(JSON.stringify(fields)), // preserve JSON structure because we're not sure what XWiki will do
                },
                dataType: 'json'
            }).done(w(function (json) {
                jq.extend(true, data, json);
            }));

            // we will perform asynchronous requests for each href in parallel
            var wAttach = w();
            var wDoc = w();

            jq.ajax({
                url: url,
                dataType: 'json',
            }).done(function (json) {
                var pageName = json.fullName;

                // attachments
                var needAttachments = fields.docFields.some(function (f) {
                    return f.property === "attachments"
                });
                var attachmentRestURL = findRestURL(json, 'attachments');
                if (needAttachments && attachmentRestURL) {
                    jq.ajax({
                        url: attachmentRestURL + "?media=json",
                        dataType: 'json'
                    }).done(function (jsonA) {
                        (jsonA.attachments || []).forEach(function (attachment) {
                            // Push to the CSV
                            data["doc.attachments"] = data["doc.attachments"]  || [];
                            data["doc.attachments"].push(attachment.name);
                            // Push to the download list
                            addToAttachments(pageName, {
                                name: attachment.name,
                                size: attachment.size,
                                mimeType: attachment.mimeType,
                                url: attachment.xwikiAbsoluteUrl
                            });
                        });
                    }).always(wAttach);
                } else { wAttach(); }
                wDoc();
            }).fail(function () {
                wAttach();
                wDoc();
            });
        });
        addToQueue(function (w) {
            ctx.incrementDocumentProgress();
        });
    };

    var constructCSV = function (ctx, CSV_data, separator) {
        var fields = ctx.fields;
        var ids = [{
            id: 'document_name',
        	name: "$services.localization.render('docExporter_document')" || 'Document name'
        }];
        var addKeys = function (obj) {
            var id = obj.id;
            if (ctx.formatted) {
                ids.push({
                    id: obj.id,
                    name: obj.prettyName || obj.id
                });
    		}
            ids.push({
                id: id + '_raw',
                name: (obj.prettyName || id) + '*'
            });
        };

        // add all keys out of the 
        fields.docFields.forEach(function (obj) {
            addKeys(obj);
        });
        Object.keys(fields.objFields).forEach(function (k) {
        	fields.objFields[k].forEach(function (obj) {
                addKeys(obj);
            });
        });
        fields.otherFields.forEach(function (obj) {
            addKeys(obj);
        });

        var CSVTable = Object.keys(CSV_data).map(function (k) {
            var data = CSV_data[k];
            return ids.map(function (obj) {
                var id = obj.id;
                if (id === 'document_name') { return k; }

                var datum = data[id];
                if (typeof(datum) === 'undefined') { return ''; }
                if (datum === null) { return ''; }
                if (Array.isArray(datum)) { return datum.join(separator); }
            	return datum;
            });
        });

        var toPrettyName = function (obj) {
            return obj.name;
        };
        CSVTable.unshift(ids.map(toPrettyName));

        return new CSV(CSVTable).encode();
    };

    /* for wrapping async functions such that they can only be called once */
    var once = function (f) {
        var called;
        return function () {
            if (called) { return; }
            called = true;
            f.apply(this, Array.prototype.slice.call(arguments));
        };
    };

    // jquery ajax doesn't allow fetches of binary data, so use a raw XMLHttpRequest
    var getBinaryBlob = function (uri, cb) {
        console.log('fetching binary blob at', uri)
        var Req = new XMLHttpRequest();
        Req.open("GET", uri, true);
        Req.responseType = "arraybuffer";
        var CB = once(cb);
        Req.onload = function(oEvent) {
            CB(void 0, Req.response); // arraybuffer
        };
        Req.onerror = function (e) { CB(e); };

        Req.send();
    };

    // construct a virtual filesystem which will be transformed into a zip
    var FileSystem = function () {
		var root = new Zip();
        var structure = {};

        var add = function (path, name, file, args) {
            var l = path.length;
            var dir = root;
            for (var i = 0; i < l; i++) {
                if (structure[path[i]]) {
                    dir = structure[path[i]];
                } else {
                    dir = structure[path[i]] = dir.folder(path[i]);
                }
            }
            dir.file(name, file, args);
        };
        var zip = function (cb) {
			root.generateAsync({type: 'blob'})
            .then(function (content) {
            	cb(void 0, content);
            });
        };
        return {
			add: add,
            zip: zip,
        };
    };

    var pending = false;
    var onClick = function () {
        if (pending) { return console.error("Export already in progress"); }
        pending = true;

        // we report progress of downloads via these elements
        // so clear them in case people are running an export a second time
        documentsProgress.text("");
        attachmentsProgress.text("");
        // clear the preview table if it exists
        previewResult.html('');

        // get all the values from our inputs
        var fieldsVal = fieldsInput.val().replace(/[\n\r]/g, function (c) {
        	return '';  // remove line breaks
        });
        var fields = processFields(fieldsVal);
        var query = queryInput.val().replace(/[\n\r]/g, function (c) {
        	return '';  // remove line breaks
        });
        var separator = separatorInput.val() || ", ";

        // ctx (context) is passed into several functions to make function signatures simpler
        var ctx = {};
        ctx.fields = fields;
        ctx.formatted = formattedInput.is(':checked');

        var queue;
        // add to queue schedules the next step in our procedure
        // see nThen (https://github.com/cjdelisle/nthen)
        var addToQueue = ctx.addToQueue = function (f) {
            queue = queue.nThen(f);
        };

        var attachments = {};
        // to add resources to the list of attachments to download
        var addToAttachments = ctx.addToAttachments = function (page, obj) {
            attachments[page] = attachments[page] || [];
            attachments[page].push(obj);
        };
        // for any data that should be added to the resulting csv
        var CSV_data = ctx.CSV_data = {};

        // create a 'filesystem' which will be transformed into a .zip file
        var fs = FileSystem();
        var currentSize = 0;
        var MAX_SIZE = 1024 * 1024 * 500; // Max zip file size should be 500MB
        var zip_suffix = 0;

        // for the list of documents which will be added to the .zip file
        var documentList;

        // for our progress indicators
        var documentCount = 0;
        var documentsProcessed = 0;
     	var attachmentCount = 0;
        var attachmentsProcessed = 0;


        var failure = false;
        queue = nThen(function (w) {
            // wrapping an async call in 'w' makes it so that the following nThen block is deferred
            // wrap multiple functions in one block, and they will be executed in parallel
            getDocumentList(query, ctx, w(function (e, docList) {
                if (e) {
                    console.error(e);
                    failure = true;
                    window.alert("$services.localization.render('docExporter_docListError')");
                    return;
                }
                documentList = docList;
                documentCount = docList.length;
            }));
        }).nThen(function (w) {
            // don't proceed if you weren't able to retreive a document list
            if (failure) { return; }

            // also bail out if the result is not an array
            if (!Array.isArray(documentList)) {
                return void console.error("Expected documentList to be an Array");
            }

            // define a function to increment progress indicator and display the updated value
            ctx.incrementDocumentProgress = function () {
                documentsProcessed++;
                documentsProgress.text("" + (documentsProcessed + ' / ' + documentCount));
            };

			// iterate over the list of documents, and schedule ajax calls for each entry            
            documentList.forEach(function (doc) {
                getPageResource(doc, ctx);
            });

            // schedule the CSV construction after the documents' metadata has been retrieved
	        addToQueue(function () {
                var csv = constructCSV(ctx, CSV_data, separator);
            	fs.add([], 'export.csv', csv);
            });

            // define a function to increment and display the attachment download progress
            ctx.incrementAttachmentProgress = function () {
                attachmentsProcessed++;
                attachmentsProgress.text("" + (attachmentsProcessed + ' / ' + attachmentCount));
            };

            // queue up this task, which will be deferred until all the document metadata has been fetched
            // it will iterate over all the pages, and schedule downloads of their attachments
            addToQueue(function () {
                // add attachment hrefs to queue...
                Object.keys(attachments).forEach(function (page_name, i) {
                    var page_attachments = attachments[page_name];
                    // var path = parseFullName(page_name);
                    page_attachments.forEach(function (obj) {
                        if (!obj) { return; }
                        attachmentCount++;
                        // obj = {name, size, mimeType, url}
                        var filename = obj.name;
                        if (currentSize > MAX_SIZE) {
                            // download current fs, create a new one and reset currentSize
                            addToQueue(function (w) {
                                fs.zip(w(function (e, content) {
                                    // waitFor should proceed to next step here...
                                    // create new fileSystem here
                                    fs = FileSystem();
                                    var zipName;
                                    if (zip_suffix === 0) {
                                        zipName = 'export.zip';
                                        zip_suffix++;
                                    } else {
                                        zipName = 'export_' + (zip_suffix++) + '.zip';
                                    }
                   					console.log("saving current zip as %s", zipName)                 ;
                                    saveAs(content, zipName);
                                }));
                            });
                            // reset currentSize
                            currentSize = 0;
                        }
                        currentSize += obj.size;
                        addToQueue(function (w) {
                            // add files to your zip as they download
                            getBinaryBlob(obj.url, w(function (e, arrayBuffer) {
                                if (e) { return console.error("failed to fetch blob"); }
                                fs.add(['' + (i + 2)], filename, new Blob([arrayBuffer]));
                            }));
                        });
                        // schedule a UI update after each download completes
                        addToQueue(function (w) {
							ctx.incrementAttachmentProgress();
                        });
                    });
                });

                // when all your attachments have been downloaded, create a zip file
                // prompt the user to download it
                addToQueue(function (w) {
                    // console.log(CSV_data);
                    fs.zip(function (e, content) {
                        var zipName;
                        if (zip_suffix === 0) {
                            zipName = 'export.zip';
                            zip_suffix++;
                        } else {
                            zipName = 'export_' + (zip_suffix++) + '.zip';
                        }
                        saveAs(content, zipName);
                    });
                });
                // finally, unset 'pending' so that users can do another export if they want
                addToQueue(function () {
                    // unset pending after everything finishes
                    pending = false;
                });
            });
        });
    };

    exportButton.click(onClick);

    var onPreview = function () {
        if (pending) { return console.error("Export already in progress"); }
        pending = true;

        documentsProgress.text("");
        attachmentsProgress.text("");
        previewResult.html('');

        var query = queryInput.val().replace(/[\n\r]/g, function (c) {
            return '';  // remove line breaks
        });
        jq.ajax({
            url:"$xwiki.getURL('DocumentsExporter.DocumentsGetter', 'get', 'xpage=plain&outputSyntax=plain')",
            dataType: 'json',
            data: {
                query: query,
                preview: '1'
            },
        }).done(function (data) {
            if (data && data.error === "E_TOO_MANY_RESULTS") {
                previewResult.html("$services.localization.render('docExporter_preview_errorTooMany')");
                return;
            }
            if (!data || typeof(data) !== "object" || !Array.isArray(data.list)) {
                previewResult.html("$services.localization.render('docExporter_preview_error')");
                return;
            }
            var list = data.list || [];
            jq('<h2>', {id: 'documentsExporter-preview-title'})
                .text("$services.localization.render('docExporter_preview_title')").appendTo(previewResult);
            var table = jq('<table>', {id: 'documentsExporter-table'}).appendTo(previewResult);
            var header = jq('<thead>').appendTo(table);
            jq('<th>').text("$services.localization.render('docExporter_table_name')").appendTo(header);
            jq('<th>').text("$services.localization.render('docExporter_table_author')").appendTo(header);
            jq('<th>').text("$services.localization.render('docExporter_table_date')").appendTo(header);
            list.forEach(function (doc) {
                var line = jq('<tr>').appendTo(table);
                jq('<td>', {title: doc.name}).text(doc.name).appendTo(line);
                jq('<td>', {title: doc.author}).text(doc.author).appendTo(line);
                var dateStr = new Date(doc.date).toLocaleDateString();
                jq('<td>', {title: dateStr}).text(dateStr).appendTo(line);
            });
            console.log(list);
        }).fail(function (e) {
            console.error(e);
            window.alert("$services.localization.render('docExporter_docListError')");
        }).always(function () {
            pending = false;
        });
    };
    previewButton.click(onPreview);

    var onSaveConfiguration = function () {
        if (pending) { return console.error("Export already in progress"); }
        pending = true;

        var values = {};
        values.fields = fieldsInput.val();
        values.query = queryInput.val();
        values.separator = separatorInput.val();
        values.formatted = formattedInput.is(':checked') ? '1' : '0';

        var q = nThen(function () {

        });

        var restQuery = XM.restURL + '/objects/DocumentsExporter.ConfigurationClass/0/properties/';
        previewResult.html("$services.localization.render('docExporter_formSaving')");

        Object.keys(values).forEach(function (prop) {
            q = q.nThen(function (w) {
                console.log(prop, values[prop]);
                jq.ajax({
                    url: restQuery + prop + '?media=json',
                    type: 'PUT',
                    contentType: 'text/plain',
                    data: values[prop]
                }).done(function () {
                    console.log("done");
                }).fail(function (e) {
                    console.log("failed to save configuration value");                        
                }).always(w());
            });
